script: |
  super -f text -I q12879.spq | sort > q12879.out

inputs:
  - name: q12879.spq
    data: |
      SELECT DISTINCT + col2 + + + col1 + + 68 * + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT 97 * - + 51 + - col0 BETWEEN - 51 AND + + col2 - + ( col1 );
  - name: tab1

outputs:
  - name: q12879.out
    data: |
      4076
      4739
      6638
